import React from "react";
import { ThemeProvider } from "./context/ThemeContext";
import Hero from "./components/Hero";
import ThemeToggle from "./components/ThemeToggle";
import Projects from "./components/projects"; // ✅ NEW LINE
import "./index.css";

export default function App() {
  return (
    <ThemeProvider>
      <main className="bg-white text-black dark:bg-gray-900 dark:text-white min-h-screen transition-colors duration-300">
        <div className="absolute top-4 right-4">
          <ThemeToggle />
        </div>
        <Hero />
        <Projects /> {/* ✅ Add this line to show the projects */}
      </main>
    </ThemeProvider>
  );
}
